import React from 'react';

class app extends Component {
constructor(){
  super();
  this.state = {
    users: []
  }
}
componentWillMount() {
  fetch ('https://reqres.in/api/users')
  .then(res => res.json())
  .then(json => {
    this.state({
      users: json,
    })
  })
}
render() {
  var users = this.state.users.map((user, i) => {
    return <li key={i}>{user.nombre}</li>
  });
  return(
    <div>
      <h1>Mi Aplicaci√≥n Modificada</h1>
